import React from 'react';
import './Profile.css';
import { Link } from 'react-router-dom';

function Login() {
    return (
        <section className="profile">
            <h1 className="profile__title">Привет, Виталий!</h1>
            <form className="profile__form">
                <div className="profile__input-container">
                    <label className="profile__label" type="email" id="email">E-mail</label>
                    <input className="profile__input" type="email" id="email" placeholder="example@yandex.ru"></input>
                </div>
                <div className="profile__input-container">
                    <label className="profile__label" type="password" id="password">Пароль</label>
                    <input className="profile__input" type="password" id="password" placeholder="***"></input>
                </div>
                <button className="profile__button">Редактировать</button>
                <button className="profile__logout-button">Выйти из аккаунта</button>
            </form>
        </section>
    )
}

export default Login;
